package com.lossend.interview.code.leetcode.middle._0567;

import org.junit.jupiter.api.Test;

import static org.junit.jupiter.api.Assertions.assertFalse;
import static org.junit.jupiter.api.Assertions.assertTrue;

class SolutionTest {
    @Test
    void test() {
        assertTrue(new Solution().checkInclusion("ab", "eidbaooo"));
        assertTrue(new Solution().checkInclusion("ab", "eidoooba"));
        assertTrue(new Solution().checkInclusion("ab", "eidoooba"));
        assertTrue(new Solution().checkInclusion("abca", "eidocaba"));
        assertTrue(new Solution().checkInclusion("ab", "baeidooo"));
        assertFalse(new Solution().checkInclusion("ab", "eidboaooo"));
        assertTrue(new Solution().checkInclusion("", ""));

    }
}